import React from 'react'

const PersonAction = {
    ADD_PERSON: 'ADD_PERSON',
    EDIT_PERSON: 'EDIT_PERSON',
    LOGGED_IN: "LOGGED_IN",
    DELETE_PERSON: 'DELETE_PERSON',
}


export {PersonAction}
